import sys
from collections import defaultdict
from itertools import chain


def main():
    repository = defaultdict(list)
    for line in sys.stdin:
        if line.strip() == '***END***':
            break
        file, code = line.strip(), sys.stdin.readline().strip()
        repository[len(re.findall(r'\S', code))].append(file)
    code = sys.stdin.readline().strip()
    while code != '***END***':
        print(match(code, repository))
        code = sys.stdin.readline().strip()


def match(code, repository):
    matches = []
    for length, files in sorted(repository.items()):
        for file in files:
            matches.append((length, file))
    matches.sort()
    for length, file in matches:
        if code[:length] == file:
            return length, file
    return 0, []


